import React from "react";
import { useState } from "react";
import Msg from "./Components/Msg";
import { useEffect } from "react";
const App = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  useEffect(() => {
    fetch("http://localhost:1337/api/students").then((res) => {
      res.json().then((res) => {
        setData(res.data);
      });
    });
  }, []);
  return (
    <div>
      {!loading && (
        <ul>
          {data.map((item) => (
            <Msg key={item.id} stu={item.attributes} />
          ))}
        </ul>
      )}
      {loading&&<p></p>}
    </div>
  );
};

export default App;
